import React from "react";
import ButtonChallenge1 from "./buttonchallenge1.js";
import Table1 from "./Table1.js";
import Table2 from "./Table2.js";
import Football from "./Buttons9.js";
import Tic from "./tictac.js";

class MenuNav1 extends React.Component {
  constructor() {
    super();
    this.state = { cshow: "None Component Showing" };
  }

  myClickHandler = (event) => {
    let nam = event.target.name;
    let cshow = null;
    alert("Button Component Is: " + nam);
    switch (nam) {
      case "Table1":
        cshow = <Table1 />;
        break;
      case "Table2":
        cshow = <Table2 />;
        break;
      case "ButtonChallenge1":
        cshow = <ButtonChallenge1 />;
        break;
      case "Football":
        cshow = <Football />;
        break;
      case "Tic":
        cshow = <Tic />;
        break;
    }
    this.setState({ cshow: cshow });
  };

  render() {
    return (
      <div>
        <h1>Hi, I am MenuNav1 component.</h1>
        <h4>Click any button to see its component.</h4>
        <div style={{ backgroundColor: "#e0e0e0" }}>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Tic"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            tictac.js <br /> (Date: 6 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Football"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            Button9.js <br /> (Date: 1 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Table1"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            Table1.js <br /> (Date: 1 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Table2"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            Table2.js <br /> (Date: 4 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="ButtonChallenge1"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            ButtonChallenge1.js <br /> (Date: 4 July 2020)
          </button>
        </div>
        <div style={{ backgroundColor: "black" }}>
          <h3>Component Showing:</h3>
          <hr />
          {this.state.cshow}
        </div>
      </div>
    );
  }
}

export default MenuNav1;
